const Form = () => {


  return (

    <div className="Login">

      <h2>Welcome to Greens Kiosk</h2>

      <Form>
         <label for="firstName">Full Name</label> <br></br>
         <input type="text" name="fullname" id="fullname" placeholder="Full Name" required ></input> <br></br>
         <label for="Email">Email</label> <br></br>
         <input type="email" name="email" id="email" placeholder="Email" required ></input> <br></br>
         <label for="Password">Password</label> <br></br>
         <input type="password" name="password" id="password" placeholder="Password" required ></input> <br></br> <br></br>

         <button type="submit" name="login">Login</button>
      </Form>


    </div>

  );

}
export default Form;
